B.IN=new A.bh(B.tx,["assets/sagada_trans.webp","Sagada",u.s,"Sagada Pure Arabica Premium Beans is Medium Roast\nElevate your daily brew with the rich heritage of Sagada. These 100% Pure Arabica beans are cultivated at high altitudes in the cool climate of the Mountain Province, where volcanic soil and mountain mists produce coffee of exceptional quality and flavor.\n\nOur medium roast brings out a harmonious balance of smooth body and vibrant acidity, with tasting notes of chocolate, caramel, and a hint of citrus. Handpicked and carefully processed by local farmers, this coffee reflects the soulful tradition and craftsmanship of the Cordilleras.\n\nPerfect for pour-over, drip, or French press, each cup offers a warm, comforting taste of the mountains\u2014bold, aromatic, and unmistakably Filipino.\n\nFlavor Notes: Chocolate \xb7 Caramel \xb7 Citrus \nRoast Level: Medium \nOrigin: Sagada, Mountain Province, Philippines \nProcess: Handpicked \xb7 Washed \xb7 Sun-dried","\u20b1195",B.b3,"Medium Roast","https://www.instagram.com/remiks.brew/"],t.l)
